import React, { Components } from 'react';
import './App.css';
import { createMuiTheme } from '@material-ui/core/styles';
import NavBar from './Components/NavBar';
import SecondaryNav from './Components/SecondaryNav';
import blue from '@material-ui/core/colors/blue';

const theme = createMuiTheme({
  palette: {
    primary: {
      main: '#142357',
    },
    secondary: blue,
  },
  typography: {
    fontFamily: [
      '-apple-system',
      'BlinkMacSystemFont',
      '"Segoe UI"',
      'Roboto',
      '"Helvetica Neue"',
      'Arial',
      'sans-serif',
      '"Apple Color Emoji"',
      '"Segoe UI Emoji"',
      '"Segoe UI Symbol"',
    ].join(','),
  },
});

function App() {
  return (
    <div>
      <NavBar />
      <SecondaryNav />
    </div>
  );
}

export default App;
